// src/App.js
import React from "react";
import { BrowserRouter, Routes, Route, Navigate } from "react-router-dom";

// PAGES (adjust paths/names to match your files)
import Home from "./pages/Home";           // landing/hero page
import Auctions from "./pages/Auctions";
import Alerts from "./pages/Alerts";
import Points from "./pages/Points";
import Login from "./pages/Login";
import Register from "./pages/Register";
import NotFound from "./pages/NotFound";   // optional

// LAYOUT (optional – if you have a Navbar/Footer component)
import Navbar from "./components/Navbar";   // comment out if you don't have it
// import Footer from "./components/Footer";

export default function App() {
  return (
    <BrowserRouter>
      {/* Remove Navbar if you don’t have it */}
      <Navbar />

      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/auctions" element={<Auctions />} />
        <Route path="/alerts" element={<Alerts />} />
        <Route path="/points" element={<Points />} />
        <Route path="/login" element={<Login />} />
        <Route path="/register" element={<Register />} />

        {/* Redirect old paths if needed */}
        <Route path="/home" element={<Navigate to="/" replace />} />

        {/* Catch-all */}
        <Route path="*" element={NotFound ? <NotFound/> : <Navigate to="/" replace />} />
      </Routes>

      {/* <Footer /> */}
    </BrowserRouter>
  );
}
